import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import ClipLoader from "react-spinners/ClipLoader";
import { getProjects } from "../../redux/actions/actionCreator";
import { Projects as Project } from "../../styledComponents/Dashboard/Projects";
import icon from "../../images/more-512.webp";
const Projects = (props) => {
  const dispatch = useDispatch();
  const select = useSelector((e) => {
    return e;
  });

  const getDate = (e) => {
    let date = new Date(e);
    return date.toDateString();
  };
  useEffect(() => {
    dispatch(getProjects(props));
  }, [dispatch, props]);
  const override = `
  display: block;
  margin: 0 auto;
  border-color: black;
  margin-top: 10px;
      `;
  return (
    <Project>
      <div className="projectContainer">
        <img
          src={icon}
          alt="options"
          onClick={(e) => {
            console.log(e);
          }}
        />
        <h3>Recent Projects</h3>
        <div className="projectListing">
          {!select.projects.data ? (
            <ClipLoader css={override} size="40px" />
          ) : !select.projects.data.projects ? (
            <ClipLoader css={override} size="40px" />
          ) : (
            select.projects.data.projects.map((e) => (
              <div key={e.projects_id}>
                {/* <img
                  src={icon}
                  alt="options"
                  onClick={(e) => {
                    console.log(e);
                  }}
                /> */}
                <div className="content">
                  <p> {e.projects_name}</p>
                  <span>{getDate(e.date_created)}</span>
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </Project>
  );
};

export default Projects;
